import React, { useEffect } from "react";
import Column from "./Column";

const tasks = [
    {id: 1, title: 'cake'},
    {id: 2, title: '2'},
    {id: 3, title: '3'},
    {id: 4, title: '4'},
    {id: 5, title: '5'},
]
const Analytics = () => {
    return (
        <div>
            {tasks.map((item) => {
                return <Column
                    id={item['id']}
                    title={item['title']}
                />
            })}
        </div>
    )            
}

export default Analytics;
